import React, { useContext, useEffect } from 'react';
import TaskForm from '../task/TaskForm';
import TaskList from '../task/TaskList';
import { AuthContext } from '../../contexts/auth/AuthContext';

const Home = () => {
  const { loadUser } = useContext(AuthContext);

  useEffect(() => {
    loadUser();
  }, []);
  return (
    <div>
      <TaskForm />
      <TaskList />
    </div>
  );
};

export default Home;
